	END IF;

	IF isTransaction<1 THEN
		SET isTransaction=1;
	END IF;

	IF activeFlag>2 THEN
		SET activeFlag=1;
	END IF;

	IF activeFlag<0 THEN
		SET activeFlag=0;
	END IF;


	IF(RTRIM(LTRIM(cardnostr))='') THEN 
		set error=CONCAT(error,' input card is empty ');
		SET outFlag='980101007'; -- input card is empty
	ELSE 

		BEGIN
					IF isTransaction =1 THEN 
						BEGIN 
							START TRANSACTION;

									loop_label:LOOP

										IF i=0 THEN
										
										LEAVE loop_label;
									
										END IF;

											SELECT func_get_split_string(cardnostr,cardsplit,i) into currentCardNo;

											UPDATE cc_cardinfo SET active_time=activeTime,flag_active=activeFlag WHERE card_code=currentCardNo  and flag_active<>activeFlag;
												
											IF ROW_COUNT()<=0 THEN
												set error=CONCAT(error,currentCardNo,' not exist or already active ; ');
												set t_error_not_exist=1;
												SET outFlag='980101011';-- not exist;
											ELSE
												-- 插入日志信息 
												INSERT INTO cc_cardlog(uid, 						card_code, change_money, change_time, change_people, change_source, change_code, change_remark, card_money, change_type_did) 
												SELECT (SELECT REPLACE(UUID(),'-','')),currentCardNo,		0,activeTime,creator,'激活卡','','激活卡',card_money,'408103120003' FROM cc_cardinfo where card_code=currentCardNo ;
											END IF; 

										SET i=i-1;
									END LOOP loop_label; -- end LOOP

								IF t_error=1 THEN -- 如果操作失败了 ，更新什么的 
									ROLLBACK;
									SET outFlag='980101004';-- 有一部分操作失败了，事务回滚了
								ELSE
									IF t_error_not_exist = 1 THEN -- 如果 不符合条件 
										ROLLBACK;
									ELSE
										SET outFlag='980101006'; -- 成功
										COMMIT;
									END IF; -- 
								END IF; 
						END;
					ELSE
						BEGIN
									loop_label:LOOP

										IF i=0 THEN
										
										LEAVE loop_label;
									
										END IF;

											SELECT func_get_split_string(cardnostr,cardsplit,i) into currentCardNo;

											UPDATE cc_cardinfo SET active_time=activeTime,flag_active=activeFlag WHERE card_code=currentCardNo  and flag_active<>activeFlag;

											IF ROW_COUNT()<=0 THEN
												set error=CONCAT(error,currentCardNo,' not exist or already active ; ');
												set t_error_not_exist=1;
												SET outFlag='980101011';-- not exist;
											END IF; 

										SET i=i-1;
									END LOOP loop_label; -- end LOOP

									IF t_error_not_exist = 0 THEN -- 如果 不符合条件 
										SET outFlag='980101006'; -- 成功
									END IF; -- 
						END;
					END IF;--   END   isTransaction =1 
		END;
	END IF;
END */;;
