/*!50003 CREATE*/ /*!50020 DEFINER=`srnpr`@`%`*/ /*!50003 PROCEDURE `proc_create_present_card`(IN cardNo varchar(50), IN cardPassword varchar(50),IN taskId INT,OUT outFlag varchar(50))
BEGIN

	DECLARE cardcount INT UNSIGNED DEFAULT -1 ;
	DECLARE taskcount INT UNSIGNED DEFAULT -1 ;
	DECLARE cardMoney DECIMAL(18,2) DEFAULT 0;
	DECLARE cardSerial VARCHAR(50) DEFAULT '';
	DECLARE createTime VARCHAR(50) DEFAULT '';
	DECLARE taskisfinish INT UNSIGNED DEFAULT -1 ;
	DECLARE creator VARCHAR(50) DEFAULT '';

	/** 标记是否出错 */ 
	DECLARE t_error int default 0; 
	/** 如果出现sql异常，则将t_error设置为1后继续执行后面的操作 */ 
	DECLARE continue handler for sqlexception set t_error=1; -- 出错处理 
	

	SELECT COUNT(1) into cardcount from cc_cardinfo where card_code=cardNo;
	SELECT COUNT(1) into taskcount from cc_createtask where zid=taskId ;
	/** 设置时间 */ 
	SET createTime=CONCAT(current_timestamp,'');


	IF taskcount<1 THEN
		SET outFlag='980101002';
	ELSE
			 IF cardcount>=1 THEN
			 SET outFlag='980101003';
			 ELSE
				BEGIN
					
					/** 显示的开启事务，启动它后，autocommit值会自动设置为0 */ 
					START TRANSACTION;
					
					SELECT COUNT(1) into taskisfinish from cc_createtask where zid=taskId and card_make<card_number  FOR UPDATE;
					
					IF taskisfinish<1 THEN
						SET outFlag='980101005';
						COMMIT;
					ELSE
						SELECT card_money into cardMoney from cc_createtask where zid=taskId;
						SELECT CONCAT((CAST(serial_begin AS DECIMAL)+card_make),'') into cardSerial from cc_createtask where zid=taskId and card_make<card_number;
						
						
						UPDATE cc_createtask set card_make=card_make+1  where zid=taskId ;
						INSERT INTO cc_cardinfo(uid,card_serial,card_code,card_pass,card_money,used_money,inital_money,flag_active,begin_time,finish_time,create_time,active_time,flag_send,cc_taskid) values(
						 	 (SELECT REPLACE(UUID(),'-','')),cardSerial,cardNo,cardPassword,cardMoney,0,cardMoney,0,'','',createTime,'',0,taskId);

						 	 						-- 插入日志信息 
						INSERT INTO cc_cardlog(uid, 						card_code, change_money, change_time, change_people, change_source, change_code, change_remark, card_money, change_type_did) 
						VALUES ((SELECT REPLACE(UUID(),'-','')),cardNo,		cardMoney,createTime,creator,'初始创建','','初始创建',cardMoney,'408103120001');
						IF t_error=1 THEN 
								ROLLBACK; -- 事务回滚 
							SET outFlag='980101004';
						ELSE
							COMMIT; -- 事务提交 
							SET outFlag='980101001';
						END IF;			
	
					END IF;		
				END;
			END IF;
	END IF;
END */;;
DELIMITER ;
