/*!50003 CREATE*/ /*!50020 DEFINER=`srnpr`@`%`*/ /*!50003 PROCEDURE `proc_ff_present_card`(
in cardnostr VARCHAR(500000),
in cardsplit VARCHAR(10),
in passsplit VARCHAR(10),
in creator VARCHAR(100),
out outFlag VARCHAR(50) ,
out error VARCHAR(500000))
BEGIN

	DECLARE i int DEFAULT 0;
  DECLARE currentCardNoAndPass VARCHAR(50) DEFAULT '' ;
	DECLARE currentCardNo VARCHAR(50) DEFAULT '' ;
	DECLARE currentCardPass VARCHAR(50) DEFAULT '' ;
	DECLARE createTime VARCHAR(50) DEFAULT '';
	/** 标记是否出错 */ 
	DECLARE t_error int default 0; 
	/** 标记是否出错 */ 
	DECLARE t_error_not_exist int default 0; 
	/** 如果出现sql异常，则将t_error设置为1后继续执行后面的操作 */ 
	DECLARE continue handler for sqlexception set t_error=1; -- 出错处理 
	SELECT func_get_split_string_total(cardnostr,cardsplit) into i;

	SET error='';
	
	/** 设置时间 */ 
	SET createTime=CONCAT(current_timestamp,'');

	IF(RTRIM(LTRIM(cardnostr))='') THEN 
		set error=CONCAT(error,' input card is empty ');
		SET outFlag='980101007'; -- input card is empty
	ELSE 

		BEGIN

				START TRANSACTION;

						loop_label:LOOP

							IF i=0 THEN
							
							LEAVE loop_label;
						
							END IF;

								SELECT func_get_split_string(cardnostr,cardsplit,i) into currentCardNoAndPass;

								SELECT func_get_split_string(currentCardNoAndPass,passsplit,1) into currentCardNo;
								SELECT func_get_split_string(currentCardNoAndPass,passsplit,2) into currentCardPass;

								SELECT flag_send FROM cc_cardinfo WHERE card_code=currentCardNo  FOR UPDATE;

								IF FOUND_ROWS()>0 THEN 
											UPDATE cc_cardinfo SET flag_send=1,card_pass=currentCardPass WHERE card_code=currentCardNo  and flag_send<>1;
									
											IF ROW_COUNT()<=0 THEN
												set error=CONCAT(error,currentCardNo,' is not a valid flag ; ');
												set t_error_not_exist=1;
												SET outFlag='980101012';-- is not a valid flag ; 
											  if t_error_not_exist=1 then
													leave loop_label; 
											  end if;
											ELSE
											-- creator
												-- 插入日志信息 
												INSERT INTO cc_cardlog(uid, 						card_code, change_money, change_time, change_people, change_source, change_code, change_remark, card_money, change_type_did) 
												-- VALUES ((SELECT REPLACE(UUID(),'-','')),currentCardNo,		cardMoney,createTime,creator,'','','初始创建',cardMoney,'408103120001');
												SELECT (SELECT REPLACE(UUID(),'-','')),currentCardNo,		0,createTime,creator,'发卡','','发卡',card_money,'408103120002' FROM cc_cardinfo where card_code=currentCardNo ;

											END IF; 
								ELSE
										set error=CONCAT(error,currentCardNo,' not exist ; ');
										set t_error_not_exist=1;
										SET outFlag='980101008';-- not exist;
										if t_error_not_exist=1 then
											leave loop_label; 
										end if;
								END IF;
							SET i=i-1;
						END LOOP loop_label; -- end LOOP

					IF t_error=1 THEN -- 如果操作失败了 ，更新什么的 
						ROLLBACK;
						SET outFlag='980101010';-- 有一部分操作失败了，事务回滚了
					ELSE
						IF t_error_not_exist = 1 THEN -- 如果 不符合条件 
							ROLLBACK;
						ELSE
							SET outFlag='980101009'; -- 成功
							COMMIT;
						END IF; -- 
					END IF; 
		END;
		
	END IF;
END */;;
DELIMITER ;
