/*!50003 CREATE*/ /*!50020 DEFINER=`srnpr`@`%`*/ /*!50003 PROCEDURE `proc_lock_somekey`(in somekey VARCHAR(5000),in keysplit VARCHAR(2),out outFlag int ,out error VARCHAR(5000),out uid VARCHAR(50) )
BEGIN
	
	
	DECLARE i int DEFAULT 0;
	DECLARE lockid VARCHAR(32) DEFAULT '';
  DECLARE createTime VARCHAR(50) DEFAULT '';
	DECLARE lockCurrentKey VARCHAR(50) DEFAULT '';
	

	/** 标记是否出错 */ 
	DECLARE t_error int default 0; 
	/** 标记是否出错 */ 
	DECLARE t_error_not_exist int default 0; 
	/** 如果出现sql异常，则将t_error设置为1后继续执行后面的操作 */ 
	DECLARE continue handler for sqlexception set t_error=1; -- 出错处理 

	SELECT func_get_split_string_total(somekey,keysplit) into i;

	SELECT REPLACE(UUID(),'-','') into lockid;

	/** 设置时间 */ 
	SET createTime=CONCAT(current_timestamp,'');

	SET error='';
	SET uid=lockid;
	-- SELECT lockid;
	-- 循环加入到 cc_cardlock
	START TRANSACTION;
	loop_label:LOOP

		IF i=0 THEN
		
		LEAVE loop_label;
	
		END IF;

			
		  SELECT func_get_split_string(somekey,keysplit,i) into lockCurrentKey;

				-- 插入锁
			INSERT INTO cc_cardlock (uid,keycode,create_time) 
				SELECT lockid,lockCurrentKey,createTime ;

			IF ROW_COUNT()<=0 THEN
				set error=CONCAT(error,lockCurrentKey,' is onlock ;');
			END IF;
		

		SET i=i-1;
		END LOOP loop_label;

		-- 如果 插入失败了 ，
		IF t_error=1 THEN 
			SET outFlag=2;
			ROLLBACK;
		ELSE
			SET outFlag=1;
			COMMIT;			
		END IF;	
		
END */;;
DELIMITER ;
