/*!50003 CREATE*/ /*!50020 DEFINER=`srnpr`@`%`*/ /*!50003 PROCEDURE `proc_unlock_somekey`(in uuid VARCHAR(50) ,out outFlag int ,out error VARCHAR(5000))
BEGIN
	

	/** 标记是否出错 */ 
	DECLARE t_error int default 0; 
	/** 标记是否出错 */ 
