/*!50003 CREATE*/ /*!50020 DEFINER=`srnpr`@`%`*/ /*!50003 PROCEDURE `proc_use_presentcard`(
in cardnostr VARCHAR(5000),
in cardsplit VARCHAR(2),
in moneysplit VARCHAR(2),
in creator VARCHAR(100),
in changeCode VARCHAR(100),
in changeRemark VARCHAR(450),
in changeSource VARCHAR(45),
out outFlag VARCHAR(50) ,
out error VARCHAR(5000) )
BEGIN
	
	
	DECLARE i int DEFAULT 0;
	DECLARE lockid VARCHAR(32) DEFAULT '';
  DECLARE createTime VARCHAR(50) DEFAULT '';
	DECLARE currentCardNo VARCHAR(50) DEFAULT '' ;
	DECLARE currentCardNoWithMoney VARCHAR(100) DEFAULT '' ;
	DECLARE cardZid INT DEFAULT 0;
	DECLARE beginTime VARCHAR(50) DEFAULT '';
	DECLARE endTime VARCHAR(50) DEFAULT '';
	DECLARE flagActive INT DEFAULT 0;
	DECLARE cardNowUseMoney DECIMAL(18,2) DEFAULT 0;
	DECLARE presentTempId int DEFAULT 0;
	DECLARE currentCardPassword VARCHAR(50) DEFAULT '';

	/** 标记是否出错 */ 
	DECLARE t_error int default 0; 
	/** 标记是否出错 */ 
	DECLARE t_error_not_exist int default 0; 
	/** 如果出现sql异常，则将t_error设置为1后继续执行后面的操作 */ 
	DECLARE continue handler for sqlexception set t_error=1; -- 出错处理 

	SELECT func_get_split_string_total(cardnostr,cardsplit) into i;

	SELECT REPLACE(UUID(),'-','') into lockid;

	/** 设置时间 */ 
	SET createTime=CONCAT(current_timestamp,'');

	SET error='';
	-- SELECT lockid;
	-- 循环加入到 cc_cardlock

	loop_label:LOOP

		IF i=0 THEN
		
		LEAVE loop_label;
	
		END IF;

		  SELECT func_get_split_string(cardnostr,cardsplit,i) into currentCardNoWithMoney;

			SELECT func_get_split_string(currentCardNoWithMoney,moneysplit,1) into currentCardNo;
			SELECT func_get_split_string(currentCardNoWithMoney,moneysplit,2) into currentCardPassword;
			SELECT func_get_split_string(currentCardNoWithMoney,moneysplit,3) into cardNowUseMoney;
			
			SELECT zid INTO presentTempId FROM  cc_cardinfo where card_code=currentCardNo;
			

			IF found_rows()<=0 THEN

				IF(RTRIM(LTRIM(currentCardNo))='') THEN 
					set error=CONCAT(error,currentCardNo,' input card is empty ');
				ELSE 
					set error=CONCAT(error,currentCardNo,' card not exist or password is not correct;');
				END IF;

				
			  set t_error_not_exist=1;
			ELSE
				-- 插入锁
				INSERT INTO cc_cardlock (uid,keycode,keyid,create_time,begin_time,finish_time,flag_active,card_now_use_money,card_pass) 
					SELECT lockid,card_code,zid,createTime,begin_time,finish_time,flag_active,cardNowUseMoney,currentCardPassword  FROM  cc_cardinfo where card_code=currentCardNo;
			END IF; 

		SET i=i-1;
		END LOOP loop_label;

		-- 如果 插入失败了 ，
		IF t_error=1 THEN 
			SET outFlag='980001002';
			SET error=CONCAT(error,currentCardNo,' may be some card in cardlock ',';');
		ELSE
			-- 有些卡是不存在的
			IF t_error_not_exist = 1 THEN 
				SET outFlag='980001003';
			ELSE
				
			BEGIN -- 开始 
				DECLARE tempPass VARCHAR(50) DEFAULT '';
				declare done int;
				-- 定义游标
				DECLARE rs_cursor CURSOR FOR SELECT keycode,keyid,begin_time,finish_time,flag_active,card_now_use_money,card_pass from cc_cardlock where uid=lockid ;
				DECLARE CONTINUE HANDLER FOR NOT FOUND SET done=1;

				START TRANSACTION;

				OPEN rs_cursor; 
					cursor_loop:LOOP
						 FETCH rs_cursor into currentCardNo,cardZid, beginTime,endTime,flagActive,cardNowUseMoney,currentCardPassword ; -- 取数据

						 if done=1 then
							leave cursor_loop;
						 end if;


									-- 判读是否激活
									IF flagActive = 0 THEN
											set error=CONCAT(error,currentCardNo,' not active',';');
											set t_error_not_exist=1;
											SET outFlag='980001004';
											INSERT INTO cc_test (id,uid) values(cardZid,currentCardNo);
											-- if t_error_not_exist=1 then
											-- 	leave cursor_loop; -- 没激活跳出
											-- end if;
											
									ELSE
											

											-- 判读是否过期
											IF createTime>beginTime && beginTime<endTime THEN-- 在有效期内

													SELECT card_pass INTO tempPass FROM cc_cardinfo where zid=cardZid;

													IF tempPass<> currentCardPassword THEN -- 密码错误

															set error=CONCAT(error,currentCardNo,'  card not exist or password is not correct',';');
															set t_error_not_exist=1;
															SET outFlag='980001009';
														
													ELSE
															-- 判读金钱是否正常
															SELECT zid into cardZid FROM cc_cardinfo where zid=cardZid and card_money>=cardNowUseMoney and card_money-cardNowUseMoney<=inital_money FOR UPDATE;
															-- 添加日志
															-- 更新金钱
															UPDATE cc_cardinfo set card_money=card_money-cardNowUseMoney,used_money=used_money+cardNowUseMoney where zid=cardZid and card_money>=cardNowUseMoney and card_money-cardNowUseMoney<=inital_money;
															IF ROW_COUNT()<=0 THEN
																set error=CONCAT(error,currentCardNo,' money not enough much ',';');
																set t_error_not_exist=1;
																SET outFlag='980001005';
																-- if t_error_not_exist=1 THEN -- 如果 不符合条件 
																-- 	leave cursor_loop;-- 金钱不足跳出
																-- end if;
															ELSE
																-- 插入日志信息 
																INSERT INTO cc_cardlog(uid, 						card_code, change_money, change_time, change_people, change_source, change_code, change_remark, card_money, change_type_did) 
																SELECT (SELECT REPLACE(UUID(),'-','')),card_code,	-cardNowUseMoney,createTime,creator,changeSource,changeCode,changeRemark,card_money,'408103120004' FROM cc_cardinfo where zid=cardZid ;
															END IF; -- IF ROW_COUNT()>=1 THEN
															
													END IF; -- IF tempPass<> currentCardPassword THEN 

													
												ELSE
														
														set error=CONCAT(error,currentCardNo,' not in valid time',';');
														set t_error_not_exist=1;
														SET outFlag=6;
														-- if t_error_not_exist=1 THEN -- 如果 不符合条件 
														-- 	leave cursor_loop;-- 不在有效期内跳出
														-- end if;
												END IF; -- IF createTime>beginTime && beginTime< endTime THEN

									END IF;-- IF flag_active = 0 THEN
							
							
							
						 
					END LOOP cursor_loop;-- cursor_loop:LOOP
					CLOSE rs_cursor; -- end CURSOR

					IF t_error=1 THEN -- 如果操作失败了 ，更新什么的 
						ROLLBACK;
						SET outFlag='980001007';
					ELSE
						IF t_error_not_exist = 1 THEN -- 如果 不符合条件 
							ROLLBACK;
						ELSE
							SET outFlag='980001001';
							COMMIT;
						END IF; -- 
					END IF;
				END;			-- BEGIN -- 开始  -- 结束
			END IF;
		END IF;	
		-- 解除锁
		DELETE FROM cc_cardlock WHERE uid=lockid;
END */;;
DELIMITER ;
